{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/jasonluera/cyclistic-bike-share-analysis-in-r-capstone?scriptVersionId=131762435\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"aa6db772","metadata":{"_cell_guid":"3e125b91-a6d9-4f66-b7b0-42fee8254a72","_uuid":"bb94e61a-5e55-4662-82e4-bbb3717a34a6","jupyter":{"outputs_hidden":false},"papermill":{"duration":0.029031,"end_time":"2023-05-31T20:10:08.174844","exception":false,"start_time":"2023-05-31T20:10:08.145813","status":"completed"},"tags":[]},"source":["---  \n","title: \"Cyclistic Bike Share Analysis in R - Capstone Project\"  \n","author: \"Jason Luera\"  \n","date: \"5/22/2023\"  \n","---\n","\n","## **INTRODUCTION**\n","The following case study serves as my capstone project for the Google Data Analytics Professional Certificate. The case study presents a scenario where you act as a junior data analyst working for the fictional company Cyclistic Bike-Share. The analyst will answer key business questions by following the data analysis process: Ask, Prepare, Process, Analyze, Share, and Act. \n","\n","## **ASK**\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","\n","Cyclistic currently provides three pricing plans:\n","\n","* Single-ride-pass \n","* Full-day-pass\n","* Annual Membership\n","\n","The marketing director wants to create a campaign to convert Casual Riders (single-ride-pass or full-day-pass users) into Annual Members. The junior analyst is tasked with reviewing the prior year's trip data to gain insights into how Casual Riders and Annual Members use Cyclistic Bike-Share differently.\n","\n","Three questions will guide the future marketing program:\n","\n","1. How do annual members and casual riders use Cyclistic bikes differently?\n","2. Why would casual riders buy Cyclistic annual memberships?\n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","\n","You will produce a report with the following deliverables:\n","\n","1. A clear statement of the business task\n","2. A description of all data sources used\n","3. Documentation of any cleaning or manipulation of data\n","4. A summary of your analysis\n","5. Supporting visualizations and key findings\n","6. Your top three recommendations based on your analysis\n","\n","### **Statement Of Business Task:** \n","In order to design marketing strategies aimed at converting Casual Riders into Annual Members, the provided data shall be analyzed to better understand how Annual Members and Casual Riders differ, why Casual Riders would buy a membership, and how digital media could affect their marketing tactics.   \n","\n","### **Description Of All Data Sources Used**  \n","Trip data representing Cyclistic's past year of trip records is sourced from real world data of the bike-share company Divvy. This data is provided by Lyft Bikes and Scooters, LLC which operates the City of Chicago's Divvy bike-share service.  The data comes in the form of monthly CSV files. The CSV files can be downloaded [here](https://divvy-tripdata.s3.amazonaws.com/index.html). The Data License Agreement can be found at the following [link](https://ride.divvybikes.com/data-license-agreement).\n","\n","This data pulled for this analysis represents the past 12 months of trip data. There are 13 columns in each CSV file, each of which reprsents a single ride. The data has been sanitized so that there are no identifying records denoting a specific user. As such, we cannot use the data to determine how specific individuals use the service or to find trends in how they utilze multiple rides.  However, we do have enough data to identify general differences between the two types of riders we are concerned with; Casual Riders and Annual Members.\n","\n","## **PREPARE**\n","\n","### Package Management\n","We will use the pacman package manager to handle the installation and loading packages. \n","\n","### Install and load pacman"]},{"cell_type":"code","execution_count":1,"id":"d29bb851","metadata":{"_cell_guid":"3e125b91-a6d9-4f66-b7b0-42fee8254a72","_uuid":"bb94e61a-5e55-4662-82e4-bbb3717a34a6","collapsed":false,"execution":{"iopub.execute_input":"2023-05-31T20:10:08.234653Z","iopub.status.busy":"2023-05-31T20:10:08.232206Z","iopub.status.idle":"2023-05-31T20:10:08.39691Z","shell.execute_reply":"2023-05-31T20:10:08.39441Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.197584,"end_time":"2023-05-31T20:10:08.400131","exception":false,"start_time":"2023-05-31T20:10:08.202547","status":"completed"},"tags":[]},"outputs":[],"source":["# Commented out as the packages are already installed and available in Kaggle\n","# install.packages(\"pacman\")\n","library(pacman) "]},{"cell_type":"markdown","id":"263096fe","metadata":{"_cell_guid":"3e125b91-a6d9-4f66-b7b0-42fee8254a72","_uuid":"bb94e61a-5e55-4662-82e4-bbb3717a34a6","jupyter":{"outputs_hidden":false},"papermill":{"duration":0.029079,"end_time":"2023-05-31T20:10:08.45667","exception":false,"start_time":"2023-05-31T20:10:08.427591","status":"completed"},"tags":[]},"source":["### Install and load additional packages using pacman"]},{"cell_type":"code","execution_count":2,"id":"fd57c277","metadata":{"_cell_guid":"3e125b91-a6d9-4f66-b7b0-42fee8254a72","_uuid":"bb94e61a-5e55-4662-82e4-bbb3717a34a6","collapsed":false,"execution":{"iopub.execute_input":"2023-05-31T20:10:08.554902Z","iopub.status.busy":"2023-05-31T20:10:08.513659Z","iopub.status.idle":"2023-05-31T20:10:10.057861Z","shell.execute_reply":"2023-05-31T20:10:10.055888Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":1.576771,"e