th St     member        21312          \n","5  Clinton St & Washington Blvd member        20890          \n","6  Ellis Ave & 60th St          member        20739          \n","7  Loomis St & Lexington St     member        19832          \n","8  Wells St & Elm St            member        19419          \n","9  Clinton St & Madison St      member        19046          \n","10 Broadway & Barry Ave         member        18059          "]},"metadata":{},"output_type":"display_data"}],"source":["member_top_stations <- trips %>% \n","  group_by(start_station_name, customer_type) %>% \n","  filter(!is.na(start_station_name)) %>% \n","  filter(customer_type == \"member\") %>% \n","  summarise(number_of_rides = n()) %>% \n","  arrange(desc(number_of_rides))\n","\n","head(member_top_stations, 10)"]},{"cell_type":"markdown","id":"67ebc442","metadata":{"_cell_guid":"3e125b91-a6d9-4f66-b7b0-42fee8254a72","_uuid":"bb94e61a-5e55-4662-82e4-bbb3717a34a6","jupyter":{"outputs_hidden":false},"papermill":{"duration":0.039925,"end_time":"2023-05-31T20:11:55.400163","exception":false,"start_time":"2023-05-31T20:11:55.360238","status":"completed"},"tags":[]},"source":["\"Kingsbury St & Kinzie St\" is the most popular starting station for Annual Members, but it is not that far ahead of the next several stations that follow it.\n","\n","###  **Summary Of Analysis** \n","* **Rider Distribution**: Annual Members make up the majority of rides with 59.67% of the ride share compared to 40.33% from Casual Riders.  \n","* **Ride Duration**: Casual Riders tend to take the longest rides on average, with an average ride duration of 29 minutes compared to 13 minutes for Annual Members. \n","* **Peak Weekly Traffic**: Traffic for Casual Riders tends to peak on the weekends whereas Annual Members tend to ride more during the week days. \n","* **Peak Daily Traffic**: On average, traffic for both Casual Riders and Annual Members peaks around 5:00pm every day, with the 4:00pm to 6:00pm range being significantly higher than the rest of the day.  \n","* **Peak Seasonal Traffic**: The bike-share tends to be more popular in the summer months for both types of customers. However, the ride increase during the summer months is significantly higher with the Casual Riders compared to the Annual Members.  \n","* **Bike Preference**: Casual Riders seem to prefer Electric Bikes whereas Annual Members seem to have a very slight preference for Classic Bikes.\n","* **Ride Locality**: Casual Riders tend to stick around the Lake Shore Drive region of Downtown Chicago, rarely going more than a few blocks from it. Annual Members tend to spread their rides out more across the entire downtown Chicago area.\n","\n","## **SHARE**\n","The following includes various visualizations to support these findings.  \n","\n","### Distribution of Rides by Member Type"]},{"cell_type":"code","execution_count":38,"id":"74260a1c","metadata":{"_cell_guid":"3e125b91-a6d9-4f66-b7b0-42fee8254a72","_uuid":"bb94e61a-5e55-4662-82e4-bbb3717a34a6","collapsed":false,"execution":{"iopub.execute_input":"2023-05-31T20:11:55.483493Z","iopub.status.busy":"2023-05-31T20:11:55.481318Z","iopub.status.idle":"2023-05-31T20:11:56.765467Z","shell.execute_reply":"2023-05-31T20:11:56.76248Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":1.329609,"end_time":"2023-05-31T20:11:56.769051","exception":false,"start_time":"2023-05-31T20:11:55.439442","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wT9f8H8LvMJk33XrSFAi2bsmdZZcmUISigjK/gQEVlqLi+KPxURMGvigwF\nFAdL9t6zbAoU6B5075FmJ/f7o+VyTdOd9Nrr6/ngwSP3ySV530pevfE5kqIoAgAAAACaPx7b\nBQAAAACAZSDYAQAAAHAEgh0AAAAARyDYAQAAAHAEgh0AAAAARyDYAQAAAHAEgh0AAAAARyDY\nAQAAAHAEgh0AAAAARyDYAQAAAHAEgh0AAAAARyDYAQAAAHAEgh0AAAAARyDYAQAAAHAEgh0A\nAAAARyDYAQAAAHAEgh0AAAAARyDYAQAAAHAEgh0AAAAARyDYAQAAAHAEgh0AAAAARyDYAQAA\nAHAEgh0AAAAARyDYAQAAAHAEgh0AAAAARyDYAQAAAHAEgh0AAAAARyDYAQAAAHAEgh0AAAAA\