&amp; Webster Ave Rides: 11099\",\"Franklin St &amp; Chicago Ave Rides: 11088\",\"Franklin St &amp; Jackson Blvd Rides: 11031\",\"Canal St &amp; Madison St Rides: 11015\",\"State St &amp; Randolph St Rides: 10993\"],{\"interactive\":false,\"permanent\":false,\"direction\":\"auto\",\"opacity\":1,\"offset\":[0,0],\"textsize\":\"10px\",\"textOnly\":false,\"className\":\"\",\"sticky\":true},null]},{\"method\":\"addLayersControl\",\"args\":[[],[\"Casual\",\"Member\"],{\"collapsed\":false,\"autoZIndex\":true,\"position\":\"topright\"}]}],\"limits\":{\"lat\":[41.78509714636,41.9690808333333],\"lng\":[-87.6776919292,-87.5947713333333]}},\"evals\":[],\"jsHooks\":[]}</script>\n","\t</body>\n","</html>\n"],"text/plain":["HTML widgets cannot be represented in plain text (need html)"]},"metadata":{"text/html":{"isolated":true}},"output_type":"display_data"}],"source":["stations <- trips %>% \n","group_by(start_station_name, customer_type) %>% \n","summarise(number_of_rides = n()) %>% \n","arrange(desc(number_of_rides)) \n","\n","station_geo <- trips %>%\n","select(start_station_name, start_lat, start_lng) %>%\n","distinct(start_station_name, .keep_all = TRUE)\n","\n","geo_data <- stations %>%\n","left_join(station_geo, by = \"start_station_name\")\n","\n","ride_map <- leaflet() %>% \n","    addTiles()\n","\n","ride_map <- ride_map %>%\n","  addCircleMarkers(\n","    data = subset(geo_data[1:100,], customer_type == \"casual\"),\n","    lat = ~start_lat,\n","    lng = ~start_lng,\n","    label = ~paste(start_station_name, \"Rides:\", number_of_rides),\n","    color = \"navy\",\n","    radius = 5,\n","    group = \"Casual\",\n","    opacity = 0.5\n","  ) %>%\n","  addCircleMarkers(\n","    data = subset(geo_data[1:100,], customer_type == \"member\"),\n","    lat = ~start_lat,\n","    lng = ~start_lng,\n","    label = ~paste(start_station_name, \"Rides:\", number_of_rides),\n","    color = \"#0d98ba\",\n","    radius = 5,\n","    group = \"Member\",\n","    opacity = 0.7\n","  )\n","\n","ride_map <- ride_map %>%\n","  addLayersControl(\n","    overlayGroups = c(\"Casual\", \"Member\"),\n","    options = layersControlOptions(collapsed = FALSE)\n","  )\n","\n","ride_map"]},{"cell_type":"markdown","id":"4fdb1437","metadata":{"_cell_guid":"3e125b91-a6d9-4f66-b7b0-42fee8254a72","_uuid":"bb94e61a-5e55-4662-82e4-bbb3717a34a6","jupyter":{"outputs_hidden":false},"papermill":{"duration":0.058467,"end_time":"2023-05-31T20:12:03.209078","exception":false,"start_time":"2023-05-31T20:12:03.150611","status":"completed"},"tags":[]},"source":["## **ACT**\n","Before we offer our suggestions, lets have a quick recap of some of the key deliverables referenced earlier:\n","\n","### **Statement of Business Task:** \n","In order to design marketing strategies aimed at converting Casual Riders into Annual Members, the provided data shall be analyzed to better understand how Annual Members and Casual Riders differ, why Casual Riders would buy a membership, and how digital media could affect their marketing tactics.  \n","\n","### **Description of All Data Sources Used**\n","Trip data representing Cyclistic's past year of trip records is sourced from real world data of the bike-share company Divvy. This data is provided by Lyft Bikes and Scooters, LLC which operates the City of Chicago's Divvy bike-share service.  The data comes in the form of monthly CSV files. The CSV files can be downloaded [here](https://divvy-tripdata.s3.amazonaws.com/index.html). The Data License Agreement can be found at the following [link](https://ride.divvybikes.com/data-license-agreement).\n","\n","This data pulled for this analysis represents the past 12 months of trip data. There are 13 columns in each CSV file, each of which reprsents a single ride. The data has been sanitized so that there are no identifying records denoting a specific user. As such, we cannot use the data to determine how specific individuals use the service or to find trends in how they utilze multiple rides.  However, we do have enough data to identify general differences between the two types of riders we are concerned with; Casual Riders and Annual Members.\n","\n","### **Summary of Changes**\n","So far during the pre-processing and cleaning phase we have made the following changes:  \n","\n","* Merged 12 dataframes into one called trips.  \n","* Renamed the rideable_type column values of \"docked_bike\" to \"classic_bike\" for consistency.  \n","* Added the following columns:  \n","&nbsp;&nbsp;&nbsp;&nbsp; - date  \n","&nbsp;&nbsp;&nbsp;&nbsp; - hour  \n","&nbsp;&nbsp;&nbsp;&nbsp; - day  \n","&nbsp;&nbsp;&nbsp;&nbsp; - month  \n","&nbsp;&nbsp;&nbsp;&nbsp; - year  \n","&nbsp;&nbsp;&nbsp;&nbsp; - day_of_week  \n","&nbsp;&nbsp;&nbsp;&nbsp; - ride_duration  \n","* Renamed the following columns:  \n","&nbsp;&nbsp;&nbsp;&nbsp; - Changed rideable_type to  ride_type  \n","&nbsp;&nbsp;&nbsp;&nbsp; - Changed started_at to start_time  \n","&nbsp;&nbsp;&nbsp;&nbsp; - Changed ended_at to end_time  \n","&nbsp;&nbsp;&nbsp;&nbsp; - Changed member_casual to customer_type  \n","* Filtered out rows where the ride_duration is less than 1, including many negative duration values. \n","\n","###  **Summary of Analysis** \n","* **Rider Distribution**: Annual Members make up the majority of rides with 59.67% of the ride share compared to 40.33% from Casual Riders.  \n","* **Ride Duration**: Casual Riders tend to take the longest rides on average, with an average ride duration of 29 minutes compared to 13 minutes for Annual Members. \n","* **Peak Weekly Traffic**: Traffic for Casual Riders tends to peak on the weekends whereas Annual Members tend to ride more during the week days. \n","* **Peak Daily Traffic**: On average, traffic for both Casual Riders and Annual Members peaks around 5:00pm every day, with the 4:00pm to 6:00pm range being significantly higher than the rest of the day.  \n","* **Peak Seasonal Traffic**: The bike-share tends to be more popular in the summer months for both types of customers. However, the ride increase during the summer months is significantly higher with the Casual Riders compared to the Annual Members.  \n","* **Bike Preference**: Casual Riders seem to prefer Electric Bikes whereas Annual Members seem to have a very slight preference for Classic Bikes.\n","* **Ride Locality**: Casual Riders tend to stick around the Lake Shore Drive region of Downtown Chicago, rarely going more than a few blocks from it. Annual Members tend to spread their rides out more across the entire downtown Chicago area.\n","\n","### **Based on this analysis, my recommendations are as follows:** \n","1. **Consider adding an alternative membership or additional plans which are catered to Casual Riders**. \n","Considering that Casual Riders tend to ride mainly during the summer months, take much longer rides compared to Annual Members, and stick to a smaller area of downtown Chicago near Shoreline Drive, it seems highly probable that a large segment of this group includes visitors to Chicago.  A yearly membership may not be very appealing to this type of rider. However, you could offer additional packages which would suit them better.\n","For example, adding a summertime membership with an allowance for longer rides may be a good way to entice Casual Riders to pay for a membership. Likewise, consider offering a weekend only membership or a week long pass option, which may go a long way towards enticing different segments of Casual Riders into paying more ahead of time.\n","For those Casual Riders who do live in the downtown Chicago area, another option which may lead to more Annual Membership signups is increasing the allotted ride time for Annual Members, especially for users of Classic Bikes which are more affordable but would also take longer to reach their destination. \n","\n","2. **Initiate a survey campaign for market research**. \n","Obtain better data from actual Casual Riders to see why they use the bike-share service and why they have not signed up for an Annual Membership. Given the current data, all we can do is speculate on why Casual Riders are using the service the way that they do.  I suggest we run a targeted survey campaign focused primarily on Casual Riders. We would offer discounts or an extended ride time to a randomized selection of Casual Riders in exchange for them answering a short survey. \n","This would provide us which much better information regarding the target customer and we can hear from them directly on why they use the service and why they don't pay for the Annual Membership. That information could then be used to improve business decisions in the future.\n","\n","3. **Initiate a campaign utilizing local \"influencers\" and social media to spread the word on the benefits of an Annual Membership**. \n","Target some of the more popular \"influencers\" in town to help advertise the bike-share service to locals and visitors alike. Have those selected demonstrate how convenient the Cyclistic bike-share product is, and how easy it is to quickly get to various popular spots in downtown Chicago while using it. \n","Likewise, run a social media campaign utilizing Annual Members and offer a discount or various perks if they make a social media post mentioning why they love using Cyclistic bike-share.\n","\n","\n","### **REFERENCES**\n","\n","* [RDocumentation](https://www.rdocumentation.org/)\n","* [R Charts](https://r-charts.com/)\n","* [The R Graph Gallery](https://r-graph-gallery.com/index.html)\n","* [rstudio Community](https://community.rstudio.com/)\n","* [Kaggle Community](https://www.kaggle.com/)\n","* [Stack Overflow](https://stackoverflow.com/)  \n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":119.321296,"end_time":"2023-05-31T20:12:03.590272","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-05-31T20:10:04.268976","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}